import React from "react";
import styled from "styled-components";

const Login = () => {
  return (
    <Wrapper>
      <Container></Container>
    </Wrapper>
  );
};

export default Login;

const Wrapper = styled.div`
  height: 100%;
  width: 100%;
`;

const Container = styled.div`
  height: 50%;
  width: 30%;
`;
